import React from "react";

function Footer() {
    return (
        <footer>
            <Container>
                <Row>
                    <Col classname='text-center py-3'>Copyright &copy; Landscaping and Lawn Care</Col>
                </Row>
            </Container>
        </footer>
    )
}

export default Footer;
